// import logo from './logo.svg';
import './login.css';
import React from 'react'

class Login extends React.Component {
    render() {
        return (
            <div id="background">
                <div id="login-form">
                    <div id="login-title">
                        Login with email
                    </div>

                </div>
            </div>
        )
    }
}

export default Login;
